	private void runWithIndex() throws TechnicalException, Exception {
		Timer timer = new Timer();
		timer.startTimer();
		
		readFiles();
		
		List<Filter> filterList1 = createFilterList(this.filterNamesList1, treeSetLeft);
		query1.datasetList.get(0).setFiltersList(filterList1);
		query1.buildQuery();
		System.out.println("running 1: " + query1.getShortenedReadableUrl());
		List<String> results1 = (treeSetLeft.isEmpty() ? new ArrayList<String>() : query1.urlContentToStringList(BioMartPortalLinks.MART_SERVICE_TIMEOUT));

		List<Filter> filterList2 = createCenterFilterList(this.filterNamesList2a, this.filterNamesList2b, treeSetLeft, treeSetRight);
		query2.datasetList.get(0).setFiltersList(filterList2);
		query2.buildQuery();
		System.out.println("running 2: " + query2.getShortenedReadableUrl());
		List<String> results2 = (treeSetLeft.isEmpty() || treeSetRight.isEmpty() ? new ArrayList<String>() : query2.urlContentToStringList(BioMartPortalLinks.MART_SERVICE_TIMEOUT));
		
		List<Filter> filterList3 = createFilterList(this.filterNamesList3, treeSetRight);
		query3.datasetList.get(0).setFiltersList(filterList3);
		query3.buildQuery();
		System.out.println("running 3: " + query3.getShortenedReadableUrl());
		List<String> results3 = (treeSetRight.isEmpty() ? new ArrayList<String>() : query3.urlContentToStringList(BioMartPortalLinks.MART_SERVICE_TIMEOUT));
		
		processResults(timer, results1, results2, results3);
	}
	
	private void runWithoutIndex() throws TechnicalException, Exception {
		
		Timer timer = new Timer();
		timer.startTimer();
						
		query1.buildQuery();
		System.out.println("running 1: " + query1.getShortenedReadableUrl());
		List<String> results1 = query1.urlContentToStringList(BioMartPortalLinks.MART_SERVICE_TIMEOUT);
		
		TreeSet<String> uniqueResultsFrom1 = new TreeSet<String>(results1);		
		List<Filter> filterList2 = createFilterList(this.filterNamesList2a, uniqueResultsFrom1);	// 2b is not available when not using index
		query2.datasetList.get(0).setFiltersList(filterList2);
		query2.buildQuery();
		System.out.println("running 2: " + query2.getShortenedReadableUrl());
		List<String> results2 = (uniqueResultsFrom1.isEmpty() ? new ArrayList<String>() : query2.urlContentToStringList(BioMartPortalLinks.MART_SERVICE_TIMEOUT));
		
		TreeSet<String> uniqueResultsFrom2 = new TreeSet<String>(results2);
		List<Filter> filterList3 = createFilterList(this.filterNamesList3, uniqueResultsFrom2);
		query3.datasetList.get(0).setFiltersList(filterList3);
		query3.buildQuery();
		System.out.println("running 3: " + query3.getShortenedReadableUrl());
		List<String> results3 = (uniqueResultsFrom2.isEmpty() ? new ArrayList<String>() : query3.urlContentToStringList(BioMartPortalLinks.MART_SERVICE_TIMEOUT));
		
		processResults(timer, results1, results2, results3);
	}

	private void readFiles() throws TechnicalException, IOException {
		String errorMessage1 = LinkIndexesUtils.checkForErrors(leftFile);
		if (errorMessage1!=null) {
			throw new TechnicalException(errorMessage1);
		}
		treeSetLeft = MyUtils.getDataFromFileToTreeSet(leftFile, MyUtils.TAB_SEPARATOR);	
		System.out.println("treeSetLeft.size() = " + treeSetLeft.size());
		//System.out.println("treeSetLeft = " + treeSetLeft);
		String errorMessage2 = LinkIndexesUtils.checkForErrors(rightFile);
		if (errorMessage2!=null) {
			throw new TechnicalException(errorMessage2);
		}
		treeSetRight = MyUtils.getDataFromFileToTreeSet(rightFile, MyUtils.TAB_SEPARATOR);
		System.out.println("treeSetRight = " + treeSetRight.size());
		//System.out.println("treeSetRight = " + treeSetRight);
	}
	private void createSuperLinkIndex() throws TechnicalException, IOException {
		readFiles();
		treeSetSuperLinkIndex = CollectionsUtils.mergeTreeSetString(treeSetLeft, treeSetRight);
		System.out.println(treeSetSuperLinkIndex.size());
		System.out.println(treeSetSuperLinkIndex);
	}

	private List<Filter> createFilterList(List<String> filterNamesList, TreeSet<String> values) {
		List<Filter> filterList = new ArrayList<Filter>();
		for (String filterName : filterNamesList) {
			filterList.add(new Filter(filterName, values, true));
		}
		return filterList;
	}
	
	private List<Filter> createCenterFilterList(List<String> leftFilterNamesList, List<String> rightFilterNamesList, 
			TreeSet<String> leftValues, TreeSet<String> rightValues) {
		List<Filter> filterList = new ArrayList<Filter>();
		
		boolean sameFilter = CompareUtils.compareIgnoreCaseStringList(leftFilterNamesList, rightFilterNamesList)==0;
		// Must use one filter for both: get intersection first
		if (sameFilter) {
			TreeSet<String> treeSetBoth = new TreeSet<String>(leftValues);
			treeSetBoth.retainAll(rightValues);
			
			for (String filterName : leftFilterNamesList) {	// same as rightFilterNamesList
				filterList.add(new Filter(filterName, treeSetBoth, true));
			}
		}
		// Easy case
		else {
			for (String filterName : leftFilterNamesList) {
				filterList.add(new Filter(filterName, leftValues, true));
			}
			for (String filterName : rightFilterNamesList) {
				filterList.add(new Filter(filterName, rightValues, true));
			}
		}
		return filterList;
	}

	private void processResults(Timer timer, List<String> results1, List<String> results2, List<String> results3) throws FunctionalException {
		System.out.println(results1.size());
		System.out.println(results2.size());
		System.out.println(results3.size());
		
		TreeSet<String> results = new TreeSet<String>(results1);
		results.retainAll(results2);
		results.retainAll(results3);
		
		timer.stopTimer();
		
		System.out.println(results.size());
		System.out.println(results);
		System.out.println(timer);
	}
